import React from 'react';

const CartBuy = ({ product, setBuy, setItem }) => {
    return(
        <div>Hello I am Cart Buy: {product.quantity}
            <br />
            <button onClick={(e) => {setBuy(false); setItem(null);}}>Back To Cart</button>
        </div>
    )
}

export default CartBuy;
